summary.label:
The program is intended for preservation of history and construction of a family tree of a family. With its help you will establish the detailed list of members of a family, will add their biographies, a photo and video materials. The tree is built on graphic and hypertext canvas. The program is simple and easy in development.
Program functions:
- Drawing up of the biography of each member of a family;
- Preservation of history of a family and person;
- Construction of a general family tree (2D, 3D);
- Construction of a personal genealogical branch (2D, 3D);
- Drawing up of the generate lists;
- Drawing calendar family of events;
- Drawing up of the picture album of a family;
- Drawing up of the video album of a family;
- Storage of copies of documents;
- Birthday Reminder;
- Archiving and decompressing a ZIP;
- Import/Export GEDCOM.
